"""*Now the dataset is completely cleaned.*

  *  Handling null values by replacing with NaN and drop all unnecessary columns.

# Calculate Air Quality Index based on Formula

The Air Quality Index is a piecewise linear function of the pollutant concentration. At the boundary between the AQI categories, there is a discontinuous jump of one AQI unit. To convert from concentration to AQI this equation is used,

**Function to calculate so2 individual pollutant index(si)**

Formula used: Ip = [IHi- ILo/BPHI - BPLo] (Cp - BPLO) + ILo

* Ip = index of pollutant p

* Cp truncated concentration of pollutant p

* BPHi concentration breakpoint i.e. greater than or equal to Cp

* BPLo = concentration breakpoint i.e. less than or equal to Cp

* IHi AQI value corresponding to BPHI

* ILo AQI value corresponding to BPLo
"""

# Calculating the individual pollutant index for so2(sulphur dioxide)
def cal_SOi(so2):
  si=0
  if (so2<=40):
    si = so2*(50/40)
  elif (so2>40 and so2<=80):
    si = 50+(so2-40)*(50/40)
  elif (so2>80 and so2<-380):
    si = 100+(so2-80)*(100/300)
  elif (so2>380 and so2<=800):
    si = 200+(so2-380)*(100/420)
  elif (so2>800 and so2<=1600):
    si = 300+(so2-800)*(100/800)
  elif (so2>1600):
    si = 400+(so2-1600)*(100/800)
  return si
df['SOi'] = df['so2'].apply(cal_SOi)
data = df[['so2','SOi']]
data.head()

"""**Function to calculate no2 individual pollutant index(ni)**"""

# Calculating the individual pollutant index for no2(nitrogen dioxide)
def cal_Noi(no2):
  ni=0
  if(no2<=40):
    ni = no2*50/40
  elif (no2>40 and no2<=80):
    ni = 50+(no2-40)*(50/40)
  elif (no2>80 and no2<=180):
    ni = 100+(no2-80)*(100/100)
  elif (no2>180 and no2<=280):
    ni= 200+(no2-180)*(100/100)
  elif(no2>280 and no2<=400):
    ni= 300+(no2-280)*(100/120)
  else:
    ni = 400+(no2-400)*(100/120)
  return ni
df['Noi'] = df['no2'].apply(cal_Noi)
data = df[['no2','Noi']]
data.head()

"""**Function to calculate rspm individual pollutant index(rpi)**"""

#calculating the individual pollutant index for rspm(respirable suspended particualte matter concentration
def cal_RSPMT(rspm):
   rpi = 0
   if (rpi <= 30):
    rpi = rpi*50/30
   elif(rpi>30 and rpi<=60):
    rpi = 50+(rpi-30)*50/30
   elif(rpi>60 and rpi<=90):
    грі = 100+(грі-60)*100/30
   elif (rpi>90 and rpi<=120):
    rpi = 200+(rpi-90)*100/30
   elif(rpi>120 and rpi<=250):
    rpi=300+(грі-120)*(100/130)
   else:
    грі=400+(грі -250)*(100/130)
   return rpi

df['Rpi'] = df['rspm'].apply(cal_RSPMT)
data = df[['rspm', 'Rpi']]
data.head()

"""**Function to calculate spm individual pollutant index(spm)**"""

#calculating the individual pollutant index for spm(suspended particulate matter)

def cal_SPMi(spm):
  spi=0
  if(spm<=50):
    spi=spm*50/50
  elif(spm>50 and spm<=100):
    spi=50+(spm-50)*(50/50)
  elif(spm>100 and spm<=250):
    spi=100+(spm-100)*(100/150)
  elif(spm>250 and spm<=350):
    spi=200+(spm-250)*(100/100)
  elif (spm>350 and spm<=430):
    spi=300+(spm-350)*(100/80)
  else:
    spi=400+(spm-430)*(100/430)
  return spi

df['SPMi'] = df['spm'].apply(cal_SPMi)
data = df[['spm', 'SPMi']]
data.head()

"""**Function to calculate the air quality index(AQI) of every data value**

*using the all idividual pollutants, they are ni, si, rspmi, spmi.*
"""

def cal_aqi(si, ni, rspmi, spmi):
  aqi = 0
  if si > ni and si > rspmi and si > spmi: # Comparing with ni (float), not ['NOi'] (list)
    aqi = si
  if ni > si and ni > rspmi and ni > spmi:
    aqi = ni
  if rspmi > si and rspmi > ni and rspmi > spmi:
    aqi = rspmi
  if spmi > si and spmi > ni and spmi > rspmi:
    aqi = spmi
  return aqi

df['AQI'] = df.apply(lambda x: cal_aqi(x['SOi'], x['Noi'], x['Rpi'], x['SPMi']), axis=1) # Passing x['NOi'] to access the value
data = df[['state', 'SOi', 'Noi', 'Rpi', 'SPMi', 'AQI']]
data.head()

