# Using threshold values to classify a particular values as good, satisfactory, moderate, poor, Severe and Hazardous
def AQI_Range(x):
  if x<=50:
    return 'Good'
  elif x>50 and x<=100:
    return 'Satisfactory'
  elif x>100 and x<=200:
    return 'Moderate'
  elif x>200 and x<=300:
    return 'Poor'
  elif x>300 and x<=400:
    return 'Severe'
  elif x>400:
    return 'Hazardous'
df['AQI_Range']= df['AQI'].apply(AQI_Range)
